import Search from "./search";
import Details from "./details";

export default class Player extends Component {
  render() {
    const style = {
      marginTop: "150px"
    };
    return (
      <div style={style}>
        <Search />
        <Details title={"Track Title"} />
      </div>
    );
  }
}
